import { Card } from "./Card"
import 'MemoryCard.css'

export const MemoryCards = ({cards}) => {

  return (
    <div className='card-grid'>
      {
        cards.map((card) => (
          <div className='card' key={card.id}>
            <Card cardSrc={card.src} />
          </div>
        ))
      }
    </div>
  )
}
